import React from 'react';
import './Card.css'

const Card = (props) => {
    console.log(props.card);
    const {name,img,salary, location,level,age} =props.card;
    return (
        <div>
            <div className="card-image">
            <img src={img}/>
            </div>
            <h2> {name}</h2>
            <h4> Hourly payment:{salary}</h4>
            <h4> Home town:{location}</h4>
            <h4> {age}</h4>
            <h4> {level}</h4>
        </div>
    );
};

export default Card;
